export class AverageSessionModel {
	constructor(data) {
		this.id = data.userId;
		this.sessions = data.sessions;
	}

	getProcessedData() {
		let weekDays = ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'];
		let datas = [];
		this.sessions.forEach((session) => {
			datas.push({
				day: weekDays[session.day],
				sessionLength: session.sessionLength,
			});
		});
		console.log(datas);
		return datas;
	}
}
